import axios  from 'axios';
import cheerio  from 'cheerio';

import competitions from '../competitions.js';
import routes from './routes.js';

import FormData from 'form-data';

const getHtmlRoundData = async (round, phase, competition, season) => {
  try {
    const url = competitions.getByAbr(competition) === competitions.LEBORO ? routes.matches.oro : routes.matches.oro
    let bodyFormData = new FormData();
    bodyFormData.append("_ctl0:temporadasDropDownList", season)
    bodyFormData.append("_ctl0:gruposDropDownList", phase)
    bodyFormData.append("_ctl0:jornadasDropDownList", round)
    bodyFormData.append("__EVENTTARGET", "_ctl0$jornadasDropDownList")
    bodyFormData.append("__VIEWSTATE", "")
    bodyFormData.append("__VIEWSTATEGENERATOR", "980642AA")
    bodyFormData.append("__EVENTVALIDATION", "")
    return await axios({
      method: 'post',
      url: url,
      data: bodyFormData,
      headers: {
          'Content-Type': 'multipart/form-data',
      },
  });
  } catch (error) {
    console.error(error)
  }
}

const getMatchesFromRound = (html) => {
  const $ = cheerio.load(html)
  const idsMatches = []
  $(".wrap-resultado-info-ficha").each(function(){
    idsMatches.push($(this).attr("id"))
  })
  return idsMatches
}

export const processRound = async (round, phase, competition, season) => {
  const html = await getHtmlRoundData(round, phase, competition, season)
  return getMatchesFromRound(html.data)
}